const blockIconURI = 'data:image/png;base64,';


class CoolExtension {
  getInfo() {
    return {
      id: 'myextensionexample',
      name: 'Cool Extension',
      blockIconURI: blockIconURI,
      blocks: [
        {
          opcode: 'e',
          blockType: Scratch.BlockType.BOOLEAN,
          text: 'e'
        },
        {
          opcode: 'strictlyEquals',
          blockType: Scratch.BlockType.REPORTER,
          text: '[ONE] to the power of [TWO]',
          arguments: {
            ONE: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: '2'
            },
            TWO: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: '2'
            }
          }
        },
        {
        opcode: 'sadIcon',
        blockType: Scratch.BlockType.COMMAND,
        text: 'When you made the extension sad :('
        }
      ]
    };
  }
  e() {
    return 'doo doo fart';
  }
  strictlyEquals(args) {
    var x = args.ONE;
    var y = args.TWO;
    return Math.pow(x, y);
  }
  sadIcon() {
  const blockIconURI = "image/png;base64,";
  }
}

Scratch.extensions.register(new CoolExtension());
